import React from 'react';
// Import Icons/Images
import clock from '../img/clock.svg';
import diaphragm from '../img/diaphragm.svg';
import money from '../img/money.svg';
import teamwork from '../img/teamwork.svg';
import home2 from '../img/home2.png';
// Import Styled Components
import {
    StyledAbout,
    StyledDescription,
    StyledImage,
} from '../styles';

const ServicesSection = () => {
    return(
        <StyledAbout>
            <StyledDescription>
                <h2>High <span>quality</span> services</h2>
                <div className="cards">
                    <div className="card">
                        <div className="icon">
                            <img alt="icon" src={clock}/>
                            <h3>Efficient</h3>
                        </div>
                        <p>Lorem ipsum dolor sit amet.</p>
                    </div>
                    <div className="card">
                        <div className="icon">
                            <img alt="icon" src={diaphragm}/>
                            <h3>Diaphragm</h3>
                        </div>
                        <p>Lorem ipsum dolor sit amet.</p>
                    </div>
                    <div className="card">
                        <div className="icon">
                            <img alt="icon" src={money}/>
                            <h3>Affordable</h3>
                        </div>
                        <p>Lorem ipsum dolor sit amet.</p>
                    </div>
                    <div className="card">
                        <div className="icon">
                            <img alt="icon" src={teamwork}/>
                            <h3>Teamwork</h3>
                        </div>
                        <p>Lorem ipsum dolor sit amet.</p>
                    </div>
                </div>
            </StyledDescription>
            <div className="image">
                <img alt="home2 img" src={home2}/>
            </div>
        </StyledAbout>
    );
};

export default ServicesSection;
